import {combineReducers}        from 'redux';
import userAuth                 from './UserAuthReducer';
import redirectPath             from './RedirectPathReducer';
import myProfileData            from './MyProfileDataReducer';
import createOrgData            from './CreateOrganizationDataReducer';
import myOrgs                   from './MyOrgsReducer';
import orgDetails               from './OrgDetailReducer';
import createOrgApiStatus       from './CreateOrgApiStatus';
import orgFormValidation        from './OrganizationCreationValidationReducer';
import orgLocations             from './OrgLocationsReducer'

export default () => combineReducers({
    userAuth,
    redirectPath,
    myProfileData,
    createOrgData,
    myOrgs,
    orgDetails,
    createOrgApiStatus,
    orgFormValidation,
    orgLocations
});
